import axios from "axios";
import './App.css';
import {useEffect, useState} from "react";

function App() {
    const [arr, setarr]=useState([]);
    const [loading, setloading]=useState(false);
    useEffect(()=>{
        axios.get("https://api.music.msub.kr/?song=Life%20is%20Good").then(res=>{
            let data=res.data;
            setarr([
                ...arr,
                data.lineup
            ]);

        })
    }, []);

    if(!loading) return null;
  return (
      <div>
          {arr[0]}
      </div>
  );
}

export default App;
